import React, { useState } from "react";
import Banner1 from "../banner1.jpeg";
import Banner2 from "../banner2.jpeg";

function Ad(props) {
  const { address } = props;
  const [banner, setBanner] = useState(Banner1);

  function getBanner(address) {
    address == "0xf8A68F3d2C3737c26D5B33B203BD8A7FA9866EDF"
      ? (setBanner = Banner1)
      : (setBanner = Banner2);

    return banner;
  }

  return (
    <div className="adContainer">
      <img src={getBanner({ address })} alt="banner" className="banner" />
    </div>
  );
}

export default Ad;
